"policy_welcome": " HELLO AND GOOD DAY TO YOU.... Thank you for shopping with us. We work together as a Family to Bring these Days Gone By Tresure&#39;s  to you..If you have any questions please email us as we are Always Happy to Hear from you and will return a Reply A.S.A.P...Please keep in mind vintage means ,they have been Loved and cared for  ,By others through the years..They will all have some wear and patina that just&#39;s adds the character of the pieces and makes them all the more special...as they are from Days Gone By...  We Strive make note of any marks,tears,stains and cracks the item my have and as well as offer additional pictures upon request. We try and cover all conditions as we see them but might have missed something you think of that we might have missed so feel free to ask Questions.. We want you to be Happy with your Item. WE Have A Love for items of Days Gone By and are always looking for New Treasures to Bring to you So Check our Store Regularly. As well as if you have an Item you are looking for Please email us and we will watch for it during our Treasure Hunting Adventures. ",
"policy_payment": "ON SHIPPING COSTS PLEASE READ Have to add Item to cart OR Email me for shipping costs explains more below \r\n\r\nWe prefer Payment within 3 days .If there is a problem Please emails us and let us know. We Are Easy to work with.you.if payment can not be made in 3 days. We Take Pay Pal and Money Orders and Checks. If paying by Money Order or Checks Please Make them out to Robert Planken .INTERNATIONAL BUYERS PAY PAL PAYMENTS ONLY Sorry *~*~* THANKS FOR SHOPPING WITH US AND HAVE AN AWESOME DAY. *~* \r\n",
"policy_shipping": "ON SHIPPING COSTS PLEASE READ  Have to add Item to cart OR Email me for shipping costs explains more below \r\n\r\n***PLEASE NOTE*** Due to diagnostic testing Etsy is currently running shipping costs are not displaying for some accounts when you click on my &quot;Shipping & Policies&quot; tab. I know that it&#39;s confusing not to see shipping costs unless you add the item to your cart. I apologize for the inconvenience at this time, Etsy has assured all members that this is an important experiment to gather data. Please feel free to contact me for shipping quotes to your area. \r\n\r\n\r\n\r\n~* WE ship items as soon as we have cleared payment. Shipping Costs includes all the packing supplies such as bubble wrap, box, tape, ect...As well as DELIVERY CONFIRMATION     &#39;&quot;For Your Tracking Protection EXCEPT INTERNATIONAL BUYERS tracking is not available through the post office. ) .We Take GREAT CARE in packing your items up to ship to you....* All Small Items are Shipped out Priority Mail or First Class Mail in the USA..Big Huge items will ship out Parcel Post Or UPS...  HUGE ITEMS WILL NEED TO BE WEIGHED FOR PRIORITY SHIPPING IF YOU WANT PRIORITY AND THE DIFFERENCE IN COST WILL BE ADDED ON ... WHICH IS 3 DAYS SHIPPING TIME.. ***EXCEPT INTERNATIONAL SHIPPING *~*\r\n\r\n*~*  ON COMBINED SHIPPING PLEASE EMAIL US THE ITEMS YOU ARE INTERESTED IN COMBINING AND WE CAN GET A MORE ACCURATE COST FOR SHIPPING FOR YOU THANKS *~* ITEMS WITH NO SHIPPING COST FOR INTERNATIONAL SHIPPING AND YOU ARE INTERNATIONAL AND ARE INTERESTED IN THE ITEM PLEASE EMAIL US AND WE WILL GET A SHIPPING COST FOR YOU.. *~*INTERNATIONAL BUYERS AS WELL ARE RESPONSIBLE FOR ALL TAXES  OR FEE&#39;S THAT YOUR COUNTRIES CHARGES. *~*IF YOU WANT ITEMS SHIPPED WITH TRACKING (INTERNATIONAL BUYERS ) I CAN HAVE COST CHECKED AT UPS AND CHARGE YOU THE DIFFERENCE IN SHIPPING. *~*",
"policy_refunds": "We do not generally do refunds. We ask that you carefully read all descriptions and ask all questions before buying. If buying Breakables we do take Great Care to Pack these up for you, But the post office can be ruff so you might want to consider insurance on those items. If there is a problem Please emails us and give a chance to work it out with you before leaving feedback. \r\n",
"policy_additional": "We use many props in our pictures if picture has other items in the picture and it does not state the items go with  the listing THEY ARE PROPS Sorry I try to always make note in the listing but sometimes i forget to, *~*As Estsy is a Wonderful place for buyers and sellers I ask that you will Please take a Moment and leave feedback and we will do the same for you as well. We all need to work together. By providing us with feed back it helps us to serve other buyers better as well. If you can see some changes we can make to serve others feeel free to email those to us as well. We are New to Etsy but have sold on other Web sites and WE LOOK FORWARD TO OFFERING YOU THOSE WONDERFUL CHILDHOOD MEMORIES AGAIN AND GIVING GOOD SERVICE TO YOU AS WELL. FEEL FREE TO CONTACT US FOR ANY REASON. THANK YOU ONCE AGAIN FOR SHOPPING WITH US AND HAVE AN AWESOME DAY. :)\r\n",
