"title": "A Fun Place To Shop! Home Decor, Linens and Goodies!",
"announcement": "In Vintage Boxed Blonde you&#39;ll find some items belonged to my Mother, Grandma and myself. I will be sure to pass any memories and history I have of these items. My hope is you&#39;ll find something in my shop that sparks a passion in you!\r\n\r\nI LOVE WHAT I DO!\r\n\r\n&quot;Be who you are and say what you feel because those who mind don&#39;t matter and those who matter don&#39;t mind&quot;\r\n\r\nFriends shops\r\n\r\n\r\nhttp://www.etsy.com/shop/cheekyvintagecloset ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank- you for your purchase! Recycling the past one piece at a time\r\nCheers,\r\nSusan :)\r\n",
