"login_name": "vintageboxedblonde",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Vintage Boxed Blonde! I want your business and want you as a repeat customer! I will make every effort to make sure that happens. Please convo me if you are ever unhappy with an item you have received BEFORE leaving me feedback. If you have questions about an item, just ask! I am very convo friendly! I am so glad to have you as a customer. Please feel free at any time to convo me any questions.\r\n\r\nFeedback is always appreciated. I will leave you Feedback after first receiving yours.\r\n\r\nPLEASE NOTE I SHIP ONLY TO THE CONTINENTAL UNITED STATES\r\nCAN CONVO ME FOR PRICE TO SHIP ELSEWHERE. ",
"policy_payment": "Paypal , money order . Payment must be received in 24 hours. ",
"policy_shipping": "I place each item in a plastic bag and ship in a box so they get to you in perfect condition. I do like to reuse like-new boxes when possible, but let me know if you prefer a brand new box. Your item will be shipped 1 to 5 days after purchase.\r\nI ship USPS priority or parcel post , which ever is the best price.\r\nIf you would like insurance, or faster delivery convo and we will add charges to invoice.\r\nif we have over charged for shipping, convo, and we will refund difference.\r\n\r\nPLEASE NOTE THAT I SHIP ONLY TO THE CONTINENTAL UNITED STATES\r\nCONVO FOR PRICE TO SHIP ELSEWHERE.",
"policy_refunds": "Buyer pays return shipping.\r\nPlease contact prior to returning. Return item must be convo within 2 days of receipt/shipped back within 5 days of receipt for refund. \r\nRefund will be given on merchandise only.\r\nWe want you to be Happy! Please convo to resolve before leaving any feedback.",
"policy_additional": "Item or Clothing Condition â¥\r\nAt Vintage Boxed Blonde we sell mostly vintage items. Since the items are old they cannot be expected to be in new condition as they have probably been used/worn and experienced wear at some point. Any noticeable flaws will be noted in an items description, however sometimes minor flaws may be overlooked. If you&#39;d like me to scan an item again for flaws before making a purchase, please send a convo. Items are rated by condition on each item page and they are defined in the chart below:\r\n\r\nEXCELLENT: A fantastic find, near perfect!\r\nGREAT: A couple flaws or signs of wear that do not retract from the piece.\r\nGOOD: A few flaws that may be noticeable, may be able to be repaired and cleaned.\r\nFAIR: A sturdy piece, too cool to trash but probably not good enough to wear without some work.",
"policy_seller_info": "wholesale available -qualifies if over 12 items\r\nNOTE ON VINTAGE ITEMS:\r\nBe aware when purchasing Vintage items that all will arrive in used condition, some may show wear or minor age. Other items we sell may even be more desirable because of their distressed state! If there are noticeable defects we declare them, but on a rare occasion some minor defects escape our notice or seem irrelevant to the over all beauty of the item. We may find them charming and distinctive where others may have a different description for the item. It is all in the eye.\r\nBecause of this our items are SOLD-AS-IS.\r\nSo, again please do not hesitate shooting us a quick e-mail and we will do our best on our end to answer all your questions.",
