"title": "Vintage Toys Lamps Kitchenware Records Clocks Dolls",
"announcement": "ITEMS PURCHASED BETWEEN OCTOBER 3-13 WILL NOT BE MAILED UNTIL OCTOBER 14 DUE TO A DEATH IN THE FAMILY. SORRY FOR THE INCONVENIENCE Vintage Kitchenware,Toys,Records,Clocks,Lamps,Games,Books,Dolls, Bedding,and Decorative Collectibles. A Blast from the Past! Please read my Profile for more information. Check out my other shop retrograndma.etsy.com where I recycle books and records and create book purses, clocks, tablet device covers, hollow books, record clocks and containers and more!  \r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "PURCHASES MADE BETWEEN APRIL 18-27 WILL BE MAILED APRIL 28. Thank you. Please remember I DO combine shipping to save you $ if you&#39;re interested in more than one of my items OR if you purchase something from my other shop retrograndma.etsy.com.  If you would like combined shipping fees or air mail please contact me before proceeding with the paypal payment and I will then revise the invoice for you.  \r\nAll shipping costs to the USA indicated on my listings is sent by air mail, which may take approximately 5-8 business days. If you require insurance or a tracking number please contact me as shipping costs will be higher.  \r\nWithin Canada parcels are sent by regular postal mail.  \r\n To all other countries all shipping costs are surface mail which takes approximately 4-8 weeks for delivery.  If you require air mail please contact me - air mail takes approximately 7-12 business days for delivery - but the shipping costs will be higher.   PLEASE REMEMBER ALL TIMES ARE APPROXIMATE. ",
"digital_sale_message": null,
"last_updated_tsz": 1412613357,
"listing_active_count": 115,
"login_name": "RetroClassics",
"accepts_custom_requests": false,
"policy_welcome": "A Blast from the past! I have been collecting items for years and now I can share them with you! I love the thrill of searching for collectibles! If there is something in specific you are searching for please email me. Please look at my photos and read my description carefully. I try to describe everything to the best of my ability and try to take the best photographs for you. But please remember I&#39;m not an expert so ask any questions and if I end up missing something of importance about an item and you are not satisfied I would greatly appreciate an email - as I want all of my customers happy with their purchases and I will try my best to work things out. \r\nPlease check out my other shop: http://www.retrograndma.etsy.com. I recycle books and records and create unique purses, clocks, containers, earring holders and more!",
"policy_payment": "I accept Paypal and International Money Orders. I would appreciate paypal payments to be made within 3 days. If you need more time please contact me.",
"policy_shipping": "All shipping costs to the USA indicated on my listings is sent by air mail, which may take approximately 5-8 business days. If you require insurance or a tracking number please contact me as shipping costs will be higher.  Anything that weighs over 1kg will be sent expedited mail, which includes insurance and a tracking #. \r\nWithin Canada parcels are sent by regular postal mail.  \r\n To all other countries all shipping costs are surface mail which takes approximately 4-8 weeks for delivery.  If you require air mail please contact me - air mail takes approximately 7-12 business days for delivery - but the shipping costs will be higher.   PLEASE REMEMBER ALL TIMES ARE APPROXIMATE. \r\n\r\nI am from Saskatchewan and within Canada shipping costs varies from province to province and therefore my shipping costs within Canada have been averaged out as best as I could.  Within Canada we do not have a small parcel rate as I do with international parcels - so if you notice some of my smaller items may cost more to ship within Canada than it does to ship to the USA or other countries - this is due to Canada Post&#39;s shipping rates. \r\n\r\nPlease be aware that the above is all estimated delivery times. At times delivery is quicker and at times it could be slow. During the Christmas holiday rush items could take longer. I have no control over the efficiency of the postal services. \r\nThere is no tracking # with a small parcel - a tracking # is only provided with expedited parcels which are sent that method if parcels heavier than 1kg.   \r\nI DO COMBINE shipping if you&#39;re interested in more than one of my items (from both shops) Please contact me and I can revise the invoice through paypal. ",
"policy_refunds": "If an item is damaged I will request a photo of the item and then I will contact Canada Post regarding a claim. If your item is lost I will contact Canada Post. Your money will then be refunded.\r\nIf for some reason an item needs to be returned to me please contact me first. I am not responsible for returning shipping fees.",
"policy_additional": "If you&#39;re looking for something in specific please contact me as I may have it! Thanks. ",
