"title": "Troys Collectibles and Vintage Store",
"announcement": "Welcome to my vintage and collectible shop! FREE SHIPPING IN THE UNITED STATES ON ALL ITEMS IN MY SHOP!!!! I do ship internationally, but at your cost, so if you are interested in an item, contact me for shipping charges. If you have any questions at all, please feel free to contact me!! ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": " If you have any questions about an item, please feel free to message me at any time. I ONLY SHIP TO THE UNITED STATES FOR FREE!!! I will ship internationally at your expense. Please contact me for international shipping since I do not list that option. All items that are sold internationally are sold as is, and will not be returnable. In the United States  If you require faster shipping for an item, please contact me, and I can ship priority or express for an additional charge. If after purchasing an item from me you recieve it damaged or if I described it wrong, please contact me at your earliest convenience and I will gladly work out any issues with you. I accept paypal. You do not have to have paypal to use a credit card to purchase from me. simply take your item to the checkout like normal, and you will be directed to a paypal visitor page. there you can pay for your item just like you would in a direct checkout setting. I look forward to doing business with you!!",
"digital_sale_message": null,
"last_updated_tsz": 1412674771,
"listing_active_count": 206,
"login_name": "icefishertroy",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to my Collectible and Vintage Store!!",
"policy_payment": "\r\n-Don&#39;t like my price on something? Etsy doesn&#39;t have a MAKE AN OFFER button like some sites, so feel free to send me an e-mail with your offer on an item. I will get back to you asap.\r\n\r\n-I accept paypal. YOU DO NOT NEED TO HAVE PAYPAL in order to purchase items from my shop. simply take your item to the checkout like normal, and you will be taken to a paypal visitor page for one time purchases. It is simple, and you are protected under paypals buyer protection policies. When using paypal items are normally shipped same day payment is received. If you have any questions on how to use paypal, please feel free to message.\r\n\r\n- I will also accept United States Postal Service Money Orders. If money orders are not received within 5 days of purchase, item will be relisted. Please contact me for money order payment info.",
"policy_shipping": " -Shipping is free inside the the lower 48 states of the united states on all items listed in my store. the price you see is the price you pay, nothing more!! Shipping prices are increased for Alaska and Hawaii, so I will have to charge extra for shipping to these two states, so before purchasing an item, please contact me for prices. Prices will still be cheap, but I will have to charge the difference to the buyer. I also ship internationally, but at your cost, but you will need to contact me for shipping prices. All items that are purchased that are over $100 I automatically insure out of my pocket for the full value of what was purchased. \r\n-Items purchased via paypal will be shipped same day or next day depending on the time of day item was purchased.\r\n",
"policy_refunds": "-I will gladly accept returns on items within 14 days of purchase date that were damaged during shipping or that I described incorrectly. Return shipping is paid by buyer and is non-refundable. I will issue a full refund of the original purchase price when I receive the item. PLEASE SHIP RETURNS WITH A TRACKING NUMBER FOR BOTH YOUR PROTECTION AND MINE. Please send me the tracking # as well so I am aware of where the package is at. If you receive the item and there is an issue with it, please contact me as soon as possible and I will gladly work with you to resolve any issues there are.\r\n\r\n- I do not accept returns on items that are sold for RESTORATION OR REPURPOSING. These items are sold as is because they are not complete or simply need fixing, restoration or completion. Please look at the pictures carefully on these items and or ask me any questions on them before purchase, I will gladly answer any questions you may have on the item.  \r\n\r\n- I do not accept returns on items that are shipped internationally. any items that are \r\nbought outside of the united states are purchased as is. This includes items that are purchased outside of the united states and are sent to an international shipper here in the united states. \r\n\r\n-I WILL NEVER knowingly list an item that doesn&#39;t work or has damage and not mention the issues. If I list an item and I say it works, it works. If I say there is no damage, there is no damage. If you receive the item and it doesn&#39;t work or there is damage, it has happened during shipping, not while it was in my hands. If there is something I have missed and you see when you receive the item, contact me, and I will work out any issue with you.\r\n\r\n- In the event that you would like to return an item Please, contact me first. I need to know that you are returning the item. Also, do not simply refuse the item and return it to me. By refusing the item you lose your buyer protection  In the event that something should happen to the item as it is being shipped back to me, if it is lost or damaged, you can possibly be completely out of everything(this is paypals policy, not mine),  so make sure to contact me with any issues that you may have before any action is done when item is recieved. I am a fair and honest business person and I just want to make sure that anyone that buys from me is treated fairly as well and we all have a fun and enjoyable experience buying and selling on etsy!!",
"policy_additional": "Feedback/Reviews\r\n-I always appreciate reviews. If you feel that I deserve less than a 5 star rating, please contact me and tell me why before leaving it. I am a more than fair business person and am willing to work out any issues. I cannot help a buyer out if they don&#39;t contact me with issues.\r\n",
