"announcement": "â¥â¥â¥ PLEASE READ! Since becoming engaged this summer, I have decided to CLOSE MY SHOP to allow me to focus on planning our wedding. I will not be listing any new items, and any items left after closing will not be available until I reopen shop. The shop will close February 1st, 2015. I estimate that I will reopen October 2014.\r\n\r\n\r\nâ¼ Please read Shop Policies and ask all questions prior to ordering!  Thanks!!  â¼\r\n\r\nâ¥â¥â¥\r\n\r\nNorthodox had been a little seed in my brain for over a year, and I am happy to announce that it has finally grown into a reality!  Northodox combines all of my passions, creativity, upcycling, jewelry, vintage items, and art!  It is the cumulation of the things I love :) Thanks for stopping by my eclectic shop, I hope you had fun!  Above all, you will find that I am an artist who loves to create.  I am completely self-employed and plan to stay that way until I depart our beautiful world.  Shopping at Northodox gives you great deals and helps me stay independent, and hard working so thank you very much for your support!\r\n\r\nâ¥â¥â¥\r\n\r\nPLEASE READ:  \r\nEvery effort is made to ensure that your items reach you in time and in the condition I mailed them in.  Occasionally, an item becomes lost or damaged in the mail.  Items are no longer my responsibility once they leave my hands. That means if it is YOUR RESPONSIBILITY to opt for insurance on your package. Lost or damaged packages that are uninsured will NOT be refunded. Per Etsy&#39;s policy: &quot;Etsy cannot hold sellers responsible for items lost or delayed int he mail, as long as they have shipped the item according to the Etsy transaction receipt&quot;.  Again, neither Etsy nor Northodox will be held responsible for damaged or lost packages, and they will not refund your money in such an event.  Please make sure your address is correct!  I ship through Etsy to the address listed.  If your item is returned to me due to an insufficient address, it is your responsibility to pay for shipping for the correct address.  Refunds will NOT be given due to an incorrect address.\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Without YOU, there is no Northodox, so I sincerely thank you for shopping here.  I hope you enjoy your treasures and I know you will be back soon :) \r\n\r\nNOTE! Since becoming engaged this summer, I have decided to CLOSE MY SHOP to allow me to focus on planning our wedding. I will not be listing any new items, and any items left after closing will not be available until I reopen shop. The shop will close February 1st, 2015. I estimate that I will reopen October 2014.\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1412693259,
"listing_active_count": 82,
"login_name": "northodoxrocks",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Northodox! I enjoy creating and repurposing, and I hope you enjoy my creations and finds.  If you would like a custom order or are looking for a certain vintage item, feel free to convo me or email me at Northodox.Rocks@gmail.com.",
"policy_payment": "I only accept Direct Checkout through Etsy as payment. Payment is due upon purchase.\r\n \r\nI apologize to Minnesota residents, but we have to collect the Duluth St. Louis County tax rate of 7.875% for all purchases.\r\n",
"policy_shipping": "I ship Mon-Thurs since Etsy makes it super convenient to just print and ship! Please note that I do not work Friday through Sunday so I will not be available to check emails and I cannot ship orders out on those days. Custom orders and large orders DO require more shipping and creating time, and I may have to order specialty colors if you request something I do not have in stock. Please allow 2-6 weeks for custom orders.  I ship in the order that the items sell in, so if you need a package by a deadline you need to write a note to me in the notes to seller at checkout and I will accommodate you as best as I can.  Summer and Fall is a very busy time for me as I also create beach glass jewelry and sell at art shows, some of which I have to travel to get to, so shipping may be delayed.  Again, if you need an item by a deadline, write a note to seller at checkout.\r\n\r\nI am proud to announce that my vintage items are now featured at a prominent antique retailer in my home town!  This means that items may sell there before they sell here, but I will keep on top of it as best as I can.  If two people purchase the same item, it will go to the in store buyer at the local shop.\r\n\r\nI use preused and recycled packing material and boxes whenever possible, please respect our beautiful Earth and recycle or reuse them again.  Packing peanuts made from styrofoam never break down, so please do not just throw them out!  If you cannot find an alternative, just ship them back to me and I will reuse them.\r\n \r\nUnited States:\r\nOrders will be shipped via USPS first class or the lowest cost alternative. You will receive an automated email from Etsy that will confirm your shipment and will include a tracking number.\r\n \r\nUSA Orders are shipped with confirmation. I do not make money on shipping. The price covers the cost of shipping and handling only. Once the items are out of my hands, I are not responsible for lost or damaged items so I strongly recommend you purchase insurance for valuable items. (See below for more details.)\r\n \r\nInternational Orders are shipped First Class. All orders will have receipt confirmation, and if you would like to purchase tracking or insurance, just let me know in advance. Please note that orders shipped outside of the US can take 6 weeks to arrive. If you would like delivery confirmation, please convo me.  If you are an international buyer, you NEED to convo me prior to purchase for a shipping quote.\r\n \r\nADDRESS: I ship to the address listed on Etsy. Please let me know if you want item shipped to different address, or if you want the items gift-wrapped (extra charges apply).  It is your responsibility to make sure that your shipping address is accurate!  If an item is returned to me because your address was incorrect, it is your responsibility to repay for shipping to send the item back to you.  Refunds will not be given due to invalid address.",
"policy_refunds": "If for any reason you are unsatisfied with your purchase, please convo me within 48 hours with a full explanation, and I will do my very best to solve the issue. I take great pride in my work, and hope that your pieces arrive safely and in the condition I shipped them in.\r\n \r\nI DO NOT CANCEL ORDERS.  Please ask all questions before you make your purchase, I will not cancel an order, even if it has not shipped yet.  This is because when you order an item, it is pulled from my retail store&#39;s shelf and you are committed to purchasing it.\r\n\r\nReturns are generally not allowed, so please make sure you read the details if the items and ask all questions prior to purchase. Returns must be requested via convo prior to shipping the item back to me. In the rare case that I allow a return, items MUST be returned in the same packaging in which you received them. Shipping costs cannot be refunded.  Vintage items are not returnable.\r\n \r\nCustom orders cannot be refunded, but every reasonable effort will be made to ensure you are involved with the creative process so that you are happy with the result.",
"policy_additional": null,
"policy_seller_info": "April Hall\r\n5714 Wadena Street\r\nDuluth, MN 55807\r\n(218) 391-5712\r\nNorthodox.Rocks@gmail.com\r\n",
