"policy_payment": "You can use Paypal! :]",
"policy_shipping": "I ship to the address you have listed on Etsy, no exceptions. The mailing label is generated within the Etsy system using your address on file. On occasion the USPS will not accept your listed address and gives me a preferred choice which I will use to get the label generated. This usually involves the way you&#39;ve written a suite or apartment number. If the package returns due to unknown, error, incorrect address, you are responsible to pay additional shipping cost to re-send. \r\n\r\nI ship once a week which is Monday and sometime Friday (except for holidays) via USPS first class, standard and media mail with delivery confirmation included. You may request a shipping upgrade. I will work with you to make sure that you receive your item(s) in a timely and safe manner.\r\n\r\n*Note* My income is based on my item for sale not by inflating shipping costs. If the shipping costs are significantly less than I have calculated I WILL refund this difference to you. I will fully refund $5.00 and up, likewise I keep the change for shipping and handling. \r\n\r\nDomestic purchases over $100.00 receive a complimentary upgrade to priority shipping.\r\n\r\nRefunds and Exchanges:\r\n\r\nPlease keep in mind that you are purchasing vintage and antique pieces that are more than 20 years old. I have taken great care to select only gently used items and I carefully inspect each piece before listing and again while packaging them for shipment. If there are any sizable scratches or wear on the merchandise I will note this and photograph it for you to view before you purchase it. If you are not satisfied with your purchase please notify me within 3 days of receipt and I will do everything I can to help. Again, please be sure you read the description and examine the photos carefully before you order.\r\n\r\nRefund:\r\n\r\nAre issued less shipping costs, and the item must be mailed within 3 days of notification. \r\nThe item must be returned via USPS in it&#39;s original packaging, insured for the full amount of the purchase price with delivery confirmation. \r\nBuyer is responsible for return shipping costs. \r\nThe item must be returned in the same condition as when it was shipped to you.\r\n\r\nIn case of damage or loss during shipping, please notify me immediately upon receipt of the parcel, and I will provide you with information regarding filing a claim with USPS. *Do not return items damaged in shipping before contacting me, as doing so will void the shipping insurance. Be sure to keep all original packaging, as well as all pieces of the damaged item. *USPS will ask to examine the parcel when the claim is filed.\r\n\r\nUSPS requires a waiting period of 30 days from the date of mailing before filing a claim for lost items. If you have not received your parcel within reasonable period of time after receiving notice of shipment, please email me to report this problem. USPS may ask to review all email correspondence between the buyer and the seller to confirm the details.\r\nThank you.\r\n\r\nAdditional Policies and FAQs\r\nMy goal is customer satisfaction. I want you to be happy with your purchase and the service I provide you! I LOVE feedback.\r\n\r\n\r\n\r\n",
